import React, { Component } from 'react';
import './Foods.css';

class Foods extends Component {
  constructor() {
    super();

    this.state = {
      Foods: []
    }
  }

  componentDidMount(){
    fetch('/api/foods')
      .then(res => res.json())
      .then(Foods => this.setState({Foods}, () => console.log('Food fetched', Foods)));
  }

  render() {
    return(
      <div>
        <table>
          <tr>
            <th>Food Name</th>
            <th>Food Description</th>
            <th>Quantity</th>
            <th>Price Per Item</th>
          </tr>
          {this.state.Foods.map(Foods => 
            <tr key={Foods._id}>
              <th> {Foods.name} </th>
              <th> {Foods.description} </th>
              <th> {Foods.quantity} </th>
              <th> ${Foods.price} </th>
              <th> {Foods.purchased} </th>
              <th> {Foods.expires} </th>
              <th> {Foods.quantity} * {Foods.price} </th>
            </tr>
          )}
        </table>
      </div>
    );
  }
}

export default Foods;
